import React from 'react'
import Button from 'reactstrap'

export default class UpButton extends React.Component {
  render(){
    return(
      <Button
        className="p-0 plus-btn-circle m-0 mr-3 mt-1"
        color="primary"
      >
        <i className="fa fa-dollar" />
      </Button>
    );
  }
}
